											[~Fortunately,\nFrogatto can jump off of walls, too!~],
											[~To do this,\ndo a walking jump into the wall.~],
											[~If you bump into the wall\nat the crest of the jump,\nFrogatto will cling to the wall\nand slowly slide down.~],
											[~If you don't get a running start\nyou can still cling on, if you tap the\narrow toward the wall, and press jump.~],
											[~Whilst you are clinging to the wall,\npressing jump will make you rebound off.~],
											[~If two walls are facing each other,\nthis is very useful, because then you can\nrebound over and over between them.~],
											[~This lets you ascend vertical columns.~])"
