											[~You will encounter many creatures\nwho want to hurt you.~],
											[~It's often fine to just avoid them,\nbut if you have to fight,\nFrogatto's best defense is his tongue.~],
											[~You can grab enemies with the tongue,\nand then spit them back out.~],
											[~Once spat out,\nthey become a deadly projectile.~],
											[~If they don't hit anything,\nthey'll be stunned for a moment,\nand then will flip upright again.~],
											[~Whilst on their backs,\nthey're vulnerable to being stomped on.~],
											[~Sticking out the tongue and spitting,\nare both done with the attack key.~],
											[~There are a few ants just ahead.\nFeel free to try this on them.~],
